  `trainCode` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '车次代码',
  `trainType` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '车次类型',
  `fromStation` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '出发站点名字',
  `toStation` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '到达站点名字',
  `fromStationType` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '出发站点类型名 \"始|终|过\"类型',
  `toStationType` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '到达站点类型名 \"始|终|过\"类型',
  `fromTime` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '出发时间',
  `toTime` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '到达时间',
  `runTime` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '运行时间',
  `canBook` tinyint NULL DEFAULT NULL COMMENT '该车次是否有余票可以预定，所有席别无票则为false',
  `swzNum` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商务座/特等座剩余票数 有|表示充足,--|表示无此类型的座位,数字表示剩余座位数',
  `swzPrice` decimal(10, 2) NULL DEFAULT NULL COMMENT '商务座/特等座价格',
  `ydzNum` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '一等座剩余票数',
  `ydzPrice` decimal(10, 2) NULL DEFAULT NULL COMMENT '一等座价格',
  `edzNum` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '二等座剩余票数',
  `edzPrice` decimal(10, 2) NULL DEFAULT NULL COMMENT '二等座价格',
  `gjrwNum` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '高级软卧剩余票数',
  `gjrwPrice` decimal(10, 2) NULL DEFAULT NULL COMMENT '高级软卧价格',
  `rwNum` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '软卧/一等卧价格',
  `rwPrice` decimal(10, 2) NULL DEFAULT NULL COMMENT '软卧/一等卧剩余票数',
  `dwNum` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '动卧剩余票数',
  `dwPrice` decimal(10, 2) NULL DEFAULT NULL COMMENT '动卧价格',
  `ywNum` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '硬卧剩余票数',
  `ywPrice` decimal(10, 2) NULL DEFAULT NULL COMMENT '硬卧价格',
  `rzNum` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '软座剩余票数',
  `rzPrice` decimal(10, 2) NULL DEFAULT NULL COMMENT '软座价格',
  `yzNum` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '硬座剩余票数',
  `yzPrice` decimal(10, 2) NULL DEFAULT NULL COMMENT '硬座价格',
  `wzNum` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '无座剩余票数',
  `wzPrice` decimal(10, 2) NULL DEFAULT NULL COMMENT '无座价格',
  `qtNum` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '其他剩余票数',
  `qtPrice` decimal(10, 2) NULL DEFAULT NULL COMMENT '其他价格',
  `trainLines` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '车次经停站点集合',
  `fromDate` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '发车日',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3175 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

